import React from "react";

export default function Planets(props){
    return(
        <div className={props.item.name} 
             style="width: 30px;
             height: 30px;
             border-radius: 50%;
             background-color: rgb(0, 81, 255);
             position: relative;
             animation: earth-orbit 15s linear infinite;"
        >
        </div>
    )
}
